import React from 'react'
import { useNavigate } from 'react-router-dom';

const EditProfile = () => {

  const navigate = useNavigate();
  
  const redirect = () => {
    console.log("Redirect called");  // Debugging line
    navigate('/home');
  }

  return (
    <div>
      <div id="container">
        
        <h1>Edit Profile</h1>
        <button onClick={redirect}>CANCEL</button>

      </div>
    </div>
  )
}

export default EditProfile
